const AppContext = createContext();
const AppProvider = ({ children }) => {
  const testData = {
    name: "prajeet",
    age: "2",
  }

  return (
    <AppContext.Provider value={{ testData }}>
      {children}
    </AppContext.Provider>
  );
};

export { AppContext, AppProvider };
